        str="bg-noob w-screen h-screen selection:bg-slate-700 bg-cover bg-fixed"
    }else{
        console.log("wtf")
        str="bg-noob w-full h-full selection:bg-slate-700 bg-cover bg-fixed"
    }
    return(
        <div>
            <Helmet>
                <title>My Projects</title>
            </Helmet>
            <Navbar />
            <h2>Work In Progress</h2>
        </div>
    );
}
